--
-- Name: check_column_map_length(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.check_column_map_length() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE content_length INTEGER;
BEGIN
  -- split article content into words and get count
  select length(NEW.column_map) INTO content_length;

  -- throw an error if article content is too long
  IF content_length < 9 THEN
      RAISE EXCEPTION 'column_map can not be empty.';
  END IF;

  -- return the article row if no error
  RETURN NEW;
END;
$$;


ALTER FUNCTION public.check_column_map_length() OWNER TO postgres;

--
-- Name: check_is_json_object(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.check_is_json_object() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
DECLARE is_not_object_type Boolean;
BEGIN
  select jsonb_typeof(NEW.jsonb) != 'object' INTO is_not_object_type;

  -- throw an error if article content is too long
  IF is_not_object_type THEN
      RAISE EXCEPTION 'jsonb field must be a valid json.';
  END IF;

  -- return the row if no error
  RETURN NEW;
END;
$$;


ALTER FUNCTION public.check_is_json_object() OWNER TO postgres;

